import React from 'react';
import Container from 'react-bootstrap/Container';

import ContactForm from '../components/ContactForm';

function ContactPage(props) {
    return (
        <Container fluid={true}>
            <h2>{props.title}</h2>
            <ContactForm />
        </Container>
    );
}

export default ContactPage;
